INSERT INTO `notice` VALUES (1, '协助调查处理公告18', '&lt;p style=&quot;margin-top: 0px;margin-bottom: 0px;padding: 0px;color: rgb(51, 51, 51);font-family: 宋体, Arial, Verdana, Tahoma, sans-serif;font-size: 12px;white-space: normal;background-color: rgb(255, 255, 255);text-align: center&quot;&gt;&lt;span style=&quot;;padding: 0px;font-family: &amp;#39;Microsoft Yahei&amp;#39;;font-size: 16px&quot;&gt;2017年第&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-family: &amp;#39;Microsoft Yahei&amp;#39;;font-size: 16px&quot;&gt;18&lt;/span&gt;&lt;span style=&quot;;padding: 0px;font-family: &amp;#39;Microsoft Yahei&amp;#39;;font-size: 16px&quot;&gt;号&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px;margin-bottom: 0px;padding: 0px;color: rgb(51, 51, 51);font-family: 宋体, Arial, Verdana, Tahoma, sans-serif;font-size: 12px;white-space: normal;background-color: rgb(255, 255, 255)&quot;&gt;&lt;span style=&quot;;padding: 0px;font-family: &amp;#39;Microsoft Yahei&amp;#39;;font-size: 16px&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px;margin-bottom: 0px;padding: 0px;color: rgb(51, 51, 51);font-family: 宋体, Arial, Verdana, Tahoma, sans-serif;font-size: 12px;white-space: normal;background-color: rgb(255, 255, 255);text-indent: 42px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-family: &amp;#39;Microsoft Yahei&amp;#39;;font-size: 16px&quot;&gt;一、2017年5月31日，我县缉私部门在旧武装部停车场附近查获涉嫌走私鸡脚一批&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px;margin-bottom: 0px;padding: 0px;color: rgb(51, 51, 51);font-family: 宋体, Arial, Verdana, Tahoma, sans-serif;font-size: 12px;white-space: normal;background-color: rgb(255, 255, 255);text-indent: 42px&quot;&gt;&lt;span style=&quot;;padding: 0px;font-family: &amp;#39;Microsoft Yahei&amp;#39;;font-size: 16px&quot;&gt;二、2017年5月31日，我县缉私部门在旧武装部停车场附近查获涉嫌走私牛肉一批&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-top: 0px;margin-bottom: 0px;padding: 0px;color: rgb(51, 51, 51);font-family: 宋体, Arial, Verdana, Tahoma, sans-serif;font-siz