INSERT INTO `notice` VALUES (46, '专题学习会', '<h1 style=\"font-size: 24px; white-space: normal; padding: 0px; margin: 0px; list-style: none; font-family: 黑体; text-align: center; line-height: 35px; font-weight: normal; background-color: rgb(249, 251, 250);\">我市各部门举行学习贯彻习近平总书记“7·26”重要讲话精神专题学习会</h1><h2 style=\"font-size: 22px; font-weight: normal; margin: 0px; white-space: normal; padding: 0px; list-style: none; font-family: 黑体; text-align: center; line-height: 35px; background-color: rgb(249, 251, 250);\"></h2><h3 style=\"font-size: 20px; font-family: helvetica, tahoma, verdana, sans-serif; white-space: normal; padding: 0px; margin: 0px; list-style: none; text-align: center; line-height: 35px; font-weight: normal;\"></h3><p style=\"font-size: 12px; font-family: helvetica, tahoma, verdana, sans-serif; white-space: normal;\"><br/></p><p style=\"font-size: 12pt; font-family: helvetica, tahoma, verdana, sans-serif; white-space: normal; padding: 0px; margin-top: 0px; margin-bottom: 29px; list-style: none; line-height: 28px;\">　　<span style=\"font-size: 12pt; padding: 0px; margin: 0px; list-style: none; line-height: 28px;\">连日来，我市各部门纷纷举行专题学习会，传达学习习近平总书记在省部级主要领导干部“学习习近平总书记重要讲话精神，迎接党的十九大”专题研讨班上的重要讲话精神，牢固树立“四个意识”，扎实做好当前工作，以优异成绩迎接党的十九大胜利召开。</span></p><p style=\"font-size: 12pt; font-family: helvetica, tahoma, verdana, sans-serif; white-space: normal; padding: 0px; margin-top: 0px; margin-bottom: 29px; list-style: none; line-height: 28px;\">　　<strong style=\"font-size: 12px; padding: 0px; margin: 0px; list-style: none; line-height: 28px;\">市纪委</strong></p><p style=\"font-size: 12pt; font-family: helvetica, tahoma, verdana, sans-serif; white-space: normal; padding: 0px; margin-top: 0px; margin-bottom: 29px; list-style: none; line-height: 28px;\">　　7月31日，市纪委理论学习中心组举行专题学习会。会议指出，全市纪检监察机关要带头落实，把学习贯彻习近平总书记在专题研讨班上的重要讲话精神作为当前一项重要政治任务抓好抓实。广大纪检监察干部要认真学习，深刻领会，切实把思想和行动统一到习近平总书记重要讲话精神上来。要结合“两学一做”学习教育常态化制度化，迅速掀起学习贯彻习近平总书记重要讲话精神的热潮。</p><p style=\"font-size: 12pt; font-family: helvetica, tahoma, verdana, sans-serif; white-space: normal; padding: 0px; margin-top: 0px; margin-bottom: 29px; list-style: none; line-height: 28px;\">　　会议强调，要以习近平总书记重要讲话精神为引领，坚定不移地推动全面从严治党向纵深发展。一要迅速行动，及时部署学习；二要严明政治纪律，维护好中央权威；三要狠抓重点工作，当好政治生态的“护林员”；四要围绕党的十九大召开，维护好社会稳定和谐。着力营造风清气正的政治生态和干事创业的良好环境，以优异成绩迎接党的十九大胜利召开。</p><p style=\"font-size: 12pt; font-family: helvetica, tahoma, verdana, sans-serif; white-space: normal; padding: 0px; margin-top: 0px; margin-bottom: 29px; list-style: none; line-height: 28px;\">　　市委常委、市纪委书记王祝广主持会议并讲话。</p><p style=\"font-size: 12pt; font-family: helvetica, tahoma, verdana, sans-serif; white-space: normal; padding: 0px; margin-top: 0px; margin-bottom: 29px; list-style: none; line-height: 28px;\">　　<strong style=\"font-size: 12px; padding: 0px; margin: 0px; list-style: none; line-height: 28px;\">市委宣传部</strong></p><p style=\"font-size: 12pt; font-family: helvetica, tahoma, verdana, sans-serif; white-space: normal; padding: 0px; margin-top: 0px; margin-bottom: 29px; list-style: none; line-height: 28px;\">　　8月1日，市委宣传部理论学习中心组召开专题集中学习扩大会，深入学习习近平总书记在省部级领导干部专题研讨班开班式上的重要讲话精神，学习传达全国宣传部长专题会议和全区宣传思想文化系统专题工作会议精神。</p><p style=\"font-size: 12pt; font-family: helvetica, tahoma, verdana, sans-serif; white-space: normal; padding: 0px; margin-top: 0px; margin-bottom: 29px; list-style: none; line-height: 28px;\">　　会议强调，习近平总书记“7·26”重要讲话，提出了一系列新的重要思想、重要观点、重大判断、重大举措，是激励我们把中国特色社会主义事业推向前进的政治宣言，要认真学习领会，准确把握讲话精神的精神实质和丰富内涵。要以高度的政治责任感使命感，切实抓好讲话精神的宣传解读，把学习讲话精神作为当前我市理论武装工作的重点任务，精心策划新闻宣传，报道各县区各部门各单位学习贯彻落实讲话精神的实际行动和具体举措，统筹抓好网上网下宣传，引导广大党员干部群众切实把思想和行动统一到讲话精神上来，为党的十九大胜利召开营造良好的舆论氛围。要按照自治区党委宣传部和市委的统一决策部署，切实抓好意识形态和宣传思想工作，以更高的政治自觉深化习近平总书记系列重要讲话精神学习宣传，以更加丰富的形式宣传党的十八大以来的非凡历程与辉煌成就，以更多元的载体将社会主义核心价值观融入社会生活，以优异的成绩迎接党的十九大胜利召开。</p><p style=\"font-size: 12px; font-family: helvetica, tahoma, verdana, sans-serif; white-space: normal;\">发布日期：2017-08-02 &nbsp;&nbsp;来源：南宁日报 &nbsp;&nbsp;&nbsp;<br/>字体颜色：【&nbsp;<a style=\"padding: 0px; margin: 0px; list-style: none;\">红</a>&nbsp;&nbsp;<a style=\"padding: 0px; margin: 0px; list-style: none;\">黄</a>&nbsp;&nbsp;<a style=\"padding: 0px; margin: 0px; list-style: none;\">蓝</a>&nbsp;&nbsp;<a style=\"padding: 0px; margin: 0px; list-style: none;\">绿</a>】 &nbsp;&nbsp; 字体大小：【&nbsp;<a style=\"padding: 0px; margin: 0px; list-style: none;\">小</a>&nbsp;<a style=\"padding: 0px; margin: 0px; list-style: none;\">中</a>&nbsp;<a style=\"padding: 0px; margin: 0px; list-style: none;\">大</a>】 &nbsp;&nbsp; 保护视力色：&nbsp;<a title=\"青山不老\" style=\"padding: 0px; margin: 0px; list-style: none;\">青</a>&nbsp;<a title=\"蓝色回忆\" style=\"padding: 0px; margin: 0px; list-style: none;\">蓝</a>&nbsp;<a title=\"明黄清俊\" style=\"padding: 0px; margin: 0px; list-style: none;\">黄</a>&nbsp;<a title=\"灰色世界\" style=\"padding: 0px; margin: 0px; list-style: none;\">灰</a>&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"default\" style=\"padding: 0px; margin: 0px; list-style: none;\">恢复默认</span></p><p><br/></p>', 1, '李四', 7, NULL, '2017-08-03 14:55:50', '2017-08-03 14:56:20', 2);
INSERT INTO `notice` VALUES (47, '重要公告', '<p style=\"font-size: 12px; font-family: helvetica, tahoma, verdana, sans-serif; white-space: normal; text-indent: 28px;\"><span style=\"font-family: SimSun;\">为加强党员培训和党性锻炼，提高党性修养，推进“两学一做”学习教育常态化、制度化，促进支部党员不忘初心，牢记党的宗旨，争做合格党员，</span><span style=\"font-family: SimSun;\">6</span><span style=\"font-family: SimSun;\">月</span><span style=\"font-family: SimSun;\">29</span><span style=\"font-family: SimSun;\">日</span><span style=\"font-family: SimSun;\">，在党的</span><span style=\"font-family: SimSun;\">96</span><span style=\"font-family: SimSun;\">岁“生日”即将到来之际，自治区人民政府办公厅副秘书长唐宁率自治区人民政府办公厅第三秘书处、行政处、财务处和离退处</span><span style=\"font-family: SimSun;\">4</span><span style=\"font-family: SimSun;\">个党支部到我县开展主题党日活动。县委常委、组织部部长谢国志参加活动。</span></p><p style=\"font-size: 12px; font-family: helvetica, tahoma, verdana, sans-serif; white-space: normal; text-indent: 28px;\"><span style=\"font-family: SimSun;\">当天，唐宁一行首先来到龙州起义纪念馆进行参观，瞻仰革命烈士，向革命先烈敬献花篮，并温入党誓词，牢记初心，保持对党的忠诚。随后，唐宁一行来到红八军军部旧址、胡志明展馆，进一步深入体会龙州红色革命历史情怀。</span></p><p style=\"font-size: 12px; font-family: helvetica, tahoma, verdana, sans-serif; white-space: normal; text-indent: 28px;\"><span style=\"font-family: SimSun;\">在座谈会上，副县长李峥玄介绍了我县基本情况。自治区党支部与会人员结合自身工作实际，纷纷交流了参观感想。</span></p><p style=\"font-size: 12px; font-family: helvetica, tahoma, verdana, sans-serif; white-space: normal; text-indent: 28px;\"><span style=\"font-family: SimSun;\">唐宁指出，龙州是一座历史悠久的红色文化名城，具有独特的边关口岸、自然条件地理和资源优势，此次主题党日活动给各支部党员带来深刻体会，希望各党员要坚定信念，“忙而不茫”，保持对党、对国家、对事业、对人民的忠诚，为党的事业发展奉献力量；作为新时代的党员，要主动学习新知识，在工作上下功夫，更要在提高工作水平、服务水平上下大功夫，不忘初心，增强党性修养，提升内心尺度，提高个人素养。</span></p><p style=\"font-size: 12px; font-family: helvetica, tahoma, verdana, sans-serif; white-space: normal;\"><span style=\"font-family: SimSun;\">&nbsp;&nbsp;&nbsp; 当天，唐宁一行还来到县老年大学党支部副书记刘生兴家中开展慰问活动，为老党员刘生兴送上慰问品及慰问金，向他致以节日的问候和祝福。</span></p><p><br/></p>', 1, '张三', 7, NULL, '2017-08-04 10:10:40', '2017-08-04 10:11:09', 2);
