-- ----------------------------
-- Table structure for score
-- ----------------------------
DROP TABLE IF EXISTS `score`;
CREATE TABLE `score`  (
  `id` int(255) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `userId` int(255) NULL DEFAULT NULL COMMENT '用户id',
  `examination_id` int(255) NULL DEFAULT NULL COMMENT '考试id',
  `score` char(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '0' COMMENT '分数，默认0',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '成绩报表' ROW_FORMAT = Compact;

-- ----------------------------
-- Table structure for send_file
-- ----------------------------
DROP TABLE IF EXISTS `send_file`;
CREATE TABLE `send_file`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '编号',
  `owenid` bigint(20) NULL DEFAULT NULL COMMENT '归属id(报送信息)',
  `msgid` bigint(20) NULL DEFAULT 0 COMMENT '报送信息messageid（在报送信息时有）',
  `filename` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '文件名称',
  `filesuffix` varchar(15) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '文件后缀',
  `fileurl` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '文件地址',
  `filetype` int(11) NULL DEFAULT NULL COMMENT '文件类型：1-图片；2-语音；3-视频；',
  `description` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '描述',
  `filesource` int(11) NULL DEFAULT NULL COMMENT '文件来源：1-标注；2-上报',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 210 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '附件' ROW_FORMAT = Compact;

-- ----------------------------
-- Records of send_file
-- ----------------------------

-- ----------------------------
-- Table structure for send_info
-- ----------------------------
DROP TABLE IF EXISTS `send_info`;
CREATE TABLE `send_info`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '编号',
  `pid` bigint(20) NULL DEFAULT NULL COMMENT '巡防编号',
  `send_info_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '报送信息名称',
  `send_info_type` int(11) NULL DEFAULT NULL COMMENT '报送信息类型：0-基础设施；1-涉外事件；2-走私事件；3-突发事件',
  `send_info` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '报送信息内容',
  `urgency_level` int(11) NULL DEFAULT 0 COMMENT '紧急程度： 0:一般；1：紧急；2：特急',
  `longitude` double(20, 8) NULL DEFAULT NULL COMMENT '经度',
  `latitude` double(20, 8) NULL DEFAULT NULL COMMENT '纬度',
  `send_id` bigint(11) NULL DEFAULT NULL COMMENT '报送人_id',
  `receive_time` datetime(0) NULL DEFAULT NULL COMMENT '接收报送时间',
  `verify_id` bigint(11) NULL DEFAULT NULL COMMENT '审核人_id',
  `verify_time` datetime(0) NULL DEFAULT NULL COMMENT '审核时间',
  `info_status` int(11) NULL DEFAULT 0 COMMENT '信息状态：0-未查看；1-信息已查看；2-审核已通过；3-审核未通过',
  `data_status` int(11) NULL DEFAULT NULL COMMENT '数据状态：0-删除；1-正常',
  `data_origin` int(11) NULL DEFAULT NULL COMMENT '数据来源',
  `feedback` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '反馈',
  `uuid` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 130 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '报送信息' ROW_FORMAT = Compact;

-- ----------------------------
-- Records of send_info
-- ----------------------------

