-- ----------------------------
-- Table structure for video_file
-- ----------------------------
DROP TABLE IF EXISTS `video_file`;
CREATE TABLE `video_file`  (
  `id` bigint(11) NOT NULL AUTO_INCREMENT COMMENT '文件名称',
  `fileName` varchar(50) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  `fileUrl` varchar(50) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL COMMENT '文件路径',
  `createTime` datetime(0) NULL DEFAULT NULL COMMENT '创建时间',
  `userId` bigint(11) NULL DEFAULT NULL COMMENT '直播人',
  `remarks` varchar(255) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL COMMENT '备注',
  `video_type` int(11) NULL DEFAULT 0 COMMENT '信息状态：0-未查看；1-信息已查看；2-审核已通过；3-审核未通过',
  `diskPath` varchar(125) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL COMMENT '视频文件存放路径',
  `video_img` varchar(125) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL COMMENT '视频截图 ',
  `imgDiskPath` varchar(125) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL COMMENT '缩略图文件存放路径',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 38 CHARACTER SET = latin1 COLLATE = latin1_swedish_ci COMMENT = '视频回传' ROW_FORMAT = Compact;

